import React, { createContext, useReducer } from 'react';
import { placeReducer } from './placeReducer';
import initialData from './initial-data';

//try without export once you get it working
export const PlaceContext = createContext();

const PlaceContextProvider = (props) => {
    const [placeContext, dispatch]  = useReducer(placeReducer, initialData);
    return (
        <PlaceContext.Provider value={{ placeContext, dispatch }}>
            {props.children}
        </PlaceContext.Provider>
    );
}

export default PlaceContextProvider;
